description:
&quot;Bubble Boy&quot; is a comedy about a young man who was born without an immune system and has lived his life within a plastic bubble in his bedroom. When he finds out that the woman he has loved since childhood is about to be married at Niagara Falls, he builds a portable bubble suit and ventures into the outside world to win her affections. 


